import React from 'react';
import { Navbar, Nav, Container } from 'react-bootstrap';
import './Dashboard.css'; // Import the custom CSS for styling

const Dashboard = () => {
  return (
    <div className="dashboard-container">
      {/* Navbar */}
      <Navbar expand="lg" className="navbar-custom">
        <Container fluid>
          <Navbar.Brand href="#" className="navbar-brand">
            Emit Dashboard
          </Navbar.Brand>
          <Navbar.Toggle aria-controls="navbarNav" />
          <Navbar.Collapse id="navbarNav">
            <Nav className="ms-auto">
              <Nav.Link href="#home" className="nav-link">Home
              <i className="fas fa-home"></i> Home
              </Nav.Link>
              <Nav.Link href="#alerts" className="nav-link">Alerts</Nav.Link>
              <Nav.Link href="#logs" className="nav-link">Logs</Nav.Link>
              <Nav.Link href="#settings" className="nav-link">Settings</Nav.Link>
            </Nav>
          </Navbar.Collapse>
        </Container>
      </Navbar>

      <div className="content">
        <h4>Welcome to the Dashboard</h4>
        {/* Add more content or tabs here as needed */}
      </div>
    </div>
  );
};

export default Dashboard;
